import { useState } from "react";
import { useParams } from "react-router-dom";

export default function UsrePage() {
  const { id } = useParams();
  const [data, setData] = useState();
  const [dataComments, setCommentsData] = useState();
  const [loading, setLoading] = useState(true);

  console.log(data);

  useEffect(() => {
    axios
      .get(`/posts/${id}`)
      .then((res) => {
        setData(res.data);
        setLoading(false);
      })
      .catch((err) => {
        console.warn(err);
      });
  }, []);

  return (
    <>
      <div>UsrePage</div> <span>{id}</span>
    </>
  );
}
